    return(
        <>
        <form>
            <input type="text" placeholder="Book's Name"/>
            <input type="text" placeholder="Author's Name"/>
            <input type="text" placeholder="Publication's Name"/>
            <button onClick={handle}>Add Books</button>
        </form>
        </>
    );
}
export default AddVideo;
